import ScientificKeyboard from "./components/scientificKeyboard ";
import React, { useState, useEffect } from "react";
import katex from "katex";
import QRCode from "qrcode.react";
import io from "socket.io-client";
import axios from "axios";
import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import ListItemText from "@mui/material/ListItemText";
import ListItem from "@mui/material/ListItem";
import List from "@mui/material/List";
import Divider from "@mui/material/Divider";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import IconButton from "@mui/material/IconButton";
import Typography from "@mui/material/Typography";
import CloseIcon from "@mui/icons-material/Close";
import Slide from "@mui/material/Slide";
import { WindowSharp } from "@mui/icons-material";
import { createTheme, ThemeProvider } from "@mui/material/styles";

const socket = io();

const App = () => {
  const [mobileData, setMobileData] = useState("");
  const [outputValue, setOutputValue] = useState("");
  const [error, setError] = useState("");
  const [open, setOpen] = useState(false);
  const [input, setInput] = useState("");

  useEffect(() => {
    // Join a channel
    const room = "test";
    socket.emit("join", room);

    // Listen to the "image" event
    socket.on("image", (image) => {
      // Handle the received image event
      // Update the state or perform any other actions
    });

    // Cleanup the WebSocket connection when component unmounts
    return () => {
      socket.disconnect();
    };
  }, []);

  const sendDataToBackend = (value) => {
    const image = value; // Assuming the value passed is the image data

    // Emit the image event to the server
    socket.emit("image", image);
  };

  const fetchData = async (value) => {
    try {
      // Emit the "data" event to the server with the value
      socket.emit("data", value);

      // You can handle the response from the server by listening to the corresponding event
      socket.on("dataResponse", (response) => {
        // Handle the response from the server
        // Perform any necessary operations on the response data
        // Update the state or perform any other actions
      });
    } catch (error) {
      console.error(error);
      setError("Error occurred while processing the request. Please try again.");
    }
  };

  const handleChange = (event) => {
    setInput(event.target.value);
  };

  const handleInput = (value) => {
    setInput((prevInput) => prevInput + value);
    const latex = katex.renderToString(input + value);
    const inpResultField = document.getElementById("result");
    inpResultField.innerHTML = latex;
  };

  const handleKeyDown = (event) => {
    if (event.key === "Enter") {
      event.preventDefault();
      fetchData();
    }
  };

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div className="app">
      <div>
        <h1>Scientific Keyboard</h1>
        <Button variant="contained" onClick={handleClickOpen}>
          Click to Open Math Keyboard
        </Button>
      </div>

      <Dialog fullScreen open={open}>
        <AppBar position="relative">
          <Toolbar>
            <IconButton edge="start" color="inherit" onClick={handleClose} aria-label="close">
              <CloseIcon />
            </IconButton>
            <Typography variant="h1" component="div">
              Math Keyboard
            </Typography>
          </Toolbar>
        </AppBar>

        <List>
          <ListItem autoFocus button onClick={() => handleInput("1")}>
            <ListItemText primary="1" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("2")}>
            <ListItemText primary="2" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("3")}>
            <ListItemText primary="3" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("4")}>
            <ListItemText primary="4" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("5")}>
            <ListItemText primary="5" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("6")}>
            <ListItemText primary="6" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("7")}>
            <ListItemText primary="7" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("8")}>
            <ListItemText primary="8" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("9")}>
            <ListItemText primary="9" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("0")}>
            <ListItemText primary="0" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("+")}>
            <ListItemText primary="+" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("-")}>
            <ListItemText primary="-" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("*")}>
            <ListItemText primary="*" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("/")}>
            <ListItemText primary="/" />
          </ListItem>
          <Divider />
          <ListItem autoFocus button onClick={() => handleInput("=")}>
            <ListItemText primary="=" />
          </ListItem>
          <Divider />
        </List>
      </Dialog>

      <div>
        <label htmlFor="mathExpression">
          Enter Math Expression: <br />
          <input
            type="text"
            id="mathExpression"
            name="mathExpression"
            value={input}
            onChange={handleChange}
            onKeyDown={handleKeyDown}
          />
        </label>
      </div>

      <div id="result">{outputValue}</div>
      {error && <div>{error}</div>}

      <div>
        <Button variant="contained" onClick={() => sendDataToBackend(input)}>
          Send Data to Backend
        </Button>
      </div>
      <div>
        <QRCode value={input} />
      </div>

      <ScientificKeyboard />
    </div>
  );
};

export default App;
